import React from 'react'
import PageHeader from '../../Components/PageHeader'
import PageToken from '../../Components/PageToken'

const Token = () => {
  return (
    <div className="page-wrapper compact-wrapper" id="pageWrapper">
      <PageHeader/>
      <PageToken/>
    </div>
  )
}

export default Token
